    public static int nearestExit(char[][] maze, int[] entrance) {
        List<Short> queue = new ArrayList<>();

        maze[entrance[0]][entrance[1]] = '+';
        queue.add((short) (entrance[0] * 100 + entrance[1]));
        int cnt = 0;
        while (!queue.isEmpty()) {
            List<Short> buf = new ArrayList<>();
            for (short cur : queue) {
                int m = cur / 100;
                int n = cur % 100;
                if (maze[m][n] != '+' && (m == 0
                        || m == maze.length - 1
                        || n == 0
                        || n == maze[0].length - 1)) {
                    return cnt;
                }

                if (n > 0) {
                    int i = n - 1;
                    if (maze[m][i] == '.') {
                        buf.add((short) (cur - 1));
                        maze[m][i] = '-';
                    }
                }

                if (n < maze[0].length - 1) {
                    int i = n + 1;
                    if (maze[m][i] == '.') {
                        buf.add((short) (cur + 1));
                        maze[m][i] = '-';
                    }
                }

                if (m > 0) {
                    int i = m - 1;
                    if (maze[i][n] == '.') {
                        buf.add((short) (cur - 100));
                        maze[i][n] = '-';
                    }
                }

                if (m < maze.length - 1) {
                    int i = m + 1;
                    if (maze[i][n] == '.') {
                        buf.add((short) (cur + 100));
                        maze[i][n] = '-';
                    }
                }


                maze[m][n] = '+';
            }
            if (!buf.isEmpty()) {
                cnt++;
            }
            queue = buf;
        }

        return -1;
    }
